import { useState } from 'react';
import React from 'react';
import * as style from './styles';

export default function Matrix() {
  return (
    <style.Container>
      <style.Squares>
        <style.SquareRow>
          <style.Square onClick={() => console.log(10)} />
          <style.Square />
          <style.Square />
        </style.SquareRow>
        <style.SquareRow>
          <style.Square />
          <style.Square />
          <style.Square />
        </style.SquareRow>
        <style.SquareRow>
          <style.Square />
          <style.Square />
          <style.Square />
        </style.SquareRow>
      </style.Squares>
    </style.Container>
  );
}
